function parseHour(t){var e=parseInt(t.substr(0,2),10);return e>12?String(e-12+t.substr(2,5)+" PM"):0===e?"12 AM":String(e+t.substr(2,5)+" AM")}function loadTable(t){var e,r="";for(e=0;e<t.length;e++){t[e].name;var a=parseHour(t[e].start),n=parseHour(t[e].end);r+="<tr><td>"+t[e].name+"</td><td>"+a+"</td><td>"+n+"</td></tr>"}$("#display").html(r),$("#pre").hide(),$("#main").show()}var events=[];$("#load").click(function(){var t=$("#data").val(),e=JSON.parse(t);if("static"===e.type)events=e.times;else{if("oddEven"!==e.type)return;var r=(new Date).getDay()%2;events=e.times[r]}loadTable(events)});
